impl Solution {
    pub fn beautiful_indices(s: String, a: String, b: String, k: i32) -> Vec<i32> {
        let mut beautiful_indices = Vec::new();
        let mut a_indices = Vec::new();
        let mut b_indices = Vec::new();

        for i in 0..=s.len() - a.len() {
            if &s[i..i + a.len()] == a {
                a_indices.push(i as i32);
            }
        }

        for i in 0..=s.len() - b.len() {
            if &s[i..i + b.len()] == b {
                b_indices.push(i as i32);
            }
        }

        for &a_index in &a_indices {
            if b_indices.iter().any(|&b_index| (b_index - a_index).abs() <= k) {
                beautiful_indices.push(a_index);
            }
        }

        beautiful_indices.sort_unstable();
        beautiful_indices
    }
}
